import Vue from 'vue';
import Vuex from 'vuex';
import { DATATYPES, TABLESELECTIONS, sortCaseInsensitive, TABLEFIELDMAPPING, VUEROUTES, ta2DataSource, ta3DataSource, convertTA3toTA2Route } from './utils';

Vue.use(Vuex);

/*
* filters = {
*       entityType: { entityType0: '', entityType2: '' },
*       eventType: { eventType0: '', eventType2: '' },
*       relationType: { relationType0: '', relationType2: '' },
*       date: {startDate: '', endDate : ''}
*       entityName: { condition: '', values : { entityName0 :'' , entityName1 :''}
*       kbId: { condition: '', values : { kbId0 :'' , kbId1 :''}
* }
* */

const FILTERPROPS = {
    vals : 'values',
    condition: 'condition'
};

export default new Vuex.Store({
    state: {
        filters: {},
        term: {}, // type, input
        dataSourceList: [],
        currentDataSource: '',
        defaultKbDataSource: '',
        defaultHypothesisDataSource: '',
        nodeSelection: {},
        hypothesisSelection: {},
        sinSelection: {},
        categoryTypes: {},
        categoryArguments: {},
        allArguments: [], //Potentially will be used to query hypothesis based on argument names
        knowledgeBase: {},
        exploreSelections: {}, //{} - selectedTab, selectedDisplay, sort(sortBy, sortDesc), paging(resultsPerPage, pageNumber, pageStart)
        analyzeSelections: {}, //{hypothesis : {selections}, event: {selections}, relation : {selections}}; selections - sort(sortBy, sortDesc), paging(resultsPerPage, pageNumber, pageStart)
        filterReset: false,
        filterSubmission: false,
        //TODO: The following variables will be removed and functionality replaced with an API request at some point
        savedUrlParameters: {}, //{} - routeName : parameters, used for querying results without having to re-enter a search term or re-populate filter fields
        savedFilters: {}, //{} - id : filterList, used for re-populating filter fields in the filter menu
        savedHypotheses: {}, //{} - id : hypothesis cluster, used to retrieve edited hypotheses
    },
    mutations: {
        updateSingleFilters(state, update) {
            state.filters = { ...state.filters, [update.type]: update.filter };
        },
        updateCategoryFilters(state, update) {
            state.filters = { ...state.filters, [update.type]: state.filters[update.type] ? [ ...state.filters[update.type], update.filter ] : [update.filter] };
        },
        removeCategoryFilterByIndex(state, filter) {
            state.filters[filter.type].splice(filter.index, 1);
        },
        replaceCategoryFilterByIndex(state, update) {
            state.filters[update.type].splice(update.index, 1, update.filter);
        },
        updateConditionalFilters(state, update) {
            state.filters = {
                ...state.filters, [update.type]: {
                    ...state.filters[update.type],
                    [FILTERPROPS.vals]:
                        state.filters[update.type] ?
                            {
                                ...state.filters[update.type][FILTERPROPS.vals],
                                [update.id]: update.filter
                            } : {[update.id]: update.filter}
                }
            };
        },
        updateFilterCondition(state, update) {
            state.filters = { ...state.filters, [update.type]: {...state.filters[update.type], [FILTERPROPS.condition] : update[FILTERPROPS.condition] }};
        },
        updateSavedFilters(state, update) {
            state.savedFilters[update.id] = state.filters;
        },
        removeFiltersByType(state, type) {
            state.filters = {...state.filters};
            delete state.filters[type];
        },
        removeFilterByValueId(state, filter) {
            state.filters = {...state.filters};
            delete state.filters[filter.type][FILTERPROPS.vals][filter.id];
        },
        removeAllFilters(state) {
            state.filters = {};
        },
        resetFilters(state, filters) {
            state.filters = filters;
        },
        updateFilterReset(state, boolVal) {
            state.filterReset = boolVal;
        },
        updateFilterSubmission(state, boolVal) {
            state.filterSubmission = boolVal;
        },
        updateSavedHypotheses(state, update) {
            state.savedHypotheses[update.id] = update.details;
        },
        updateHypothesisMember(state, update) {
            state.savedHypotheses = {
                ...state.savedHypotheses, [update.id]: {
                    ...state.savedHypotheses[update.id],
                    [update.category] :
                        state.savedHypotheses[update.id][update.category].map(member =>
                            member[TABLEFIELDMAPPING.clusterUri] === update.details[TABLEFIELDMAPPING.clusterUri] ? update.details : member)
                }
            };
        },
        updateDataSourceList(state, dataSourceList) {
            state.dataSourceList = dataSourceList;
        },
        setDefaultKbDataSource(state, dataSource) {
            state.defaultKbDataSource = dataSource;
        },
        setDefaultHypothesisDataSource(state, dataSource) {
            state.defaultHypothesisDataSource = dataSource;
        },
        mutateCurrentDataSource(state, currentDataSource) {
            state.currentDataSource = currentDataSource;
        },
        updateNodeSelection(state, nodeSelection) {
            state.nodeSelection = nodeSelection;
        },
        updateHypothesisSelection(state, hypothesisSelection) {
            state.hypothesisSelection = hypothesisSelection;
        },
        updateSinSelection(state, sinSelection) {
            state.sinSelection = sinSelection;
        },
        updateCategoryTypes(state, data) {
            state.categoryTypes = { ...state.categoryTypes, [data.category]: data.types };
        },
        updateCategoryArguments(state, data) {
            state.categoryArguments = { ...state.categoryArguments, [data.category]: data.arguments };
        },
        updateAllArguments(state, data) {
            state.allArguments = data;
        },
        removeArgumentsAndTypes(state) {
            state.categoryArguments = {};
            state.categoryTypes = {};
            state.allArguments = [];
        },
        updateDataKB(state, data) {
            state.knowledgeBase = { ...state.knowledgeBase, [data.category]: data.response };
        },
        removeExploreKB(state) {
            state.knowledgeBase = {...state.knowledgeBase};
            delete state.knowledgeBase[DATATYPES.eventType.id];
            delete state.knowledgeBase[DATATYPES.relationType.id];
        },
        updateSavedUrlParameters(state, query) {
            state.savedUrlParameters = { ...state.savedUrlParameters, [query.name]: query.params };
        },
        removeSavedUrlParametersByRoute(state, route) {
            state.savedUrlParameters = {...state.savedUrlParameters};
            delete state.savedUrlParameters[route];
        },
        removeSavedUrlParametersByName(state, query) {
            state.savedUrlParameters = {...state.savedUrlParameters};
            delete state.savedUrlParameters[query.route][query.parameter];
        },
        updateClusterPrototype(state, data) {
            data.cluster[TABLEFIELDMAPPING.prototype][TABLEFIELDMAPPING.nodes] = data.prototype.nodes;
            data.cluster[TABLEFIELDMAPPING.nodeCount] = data.prototype.nodes.length;
            state.knowledgeBase = { ...state.knowledgeBase, [data.prototype.category]:
                    {...state.knowledgeBase[data.prototype.category], [data.prototype.id] : data.cluster}};
        },
        updateTerm(state, update) {
            state.term = {type: update.type , input : update.input};
        },
        removeTerm(state) {
            state.term = {};
        },
        addExploreSelections(state, update) {
            state.exploreSelections = { ...state.exploreSelections, [update.option]: update.value };
        },
        addExploreSortOption(state, update) {
            state.exploreSelections = { ...state.exploreSelections, [TABLESELECTIONS.sort]: { ...state.exploreSelections[TABLESELECTIONS.sort], [update.option]: update.value }};
        },
        addExplorePagingOption(state, update) {
            state.exploreSelections = { ...state.exploreSelections, [TABLESELECTIONS.paging]: { ...state.exploreSelections[TABLESELECTIONS.paging], [update.option]: update.value }};
        },
        removeExploreSelectionsByOption(state, option) {
            state.exploreSelections = {...state.exploreSelections};
            delete state.exploreSelections[option];
        },
        addAnalyzeSelections(state, update) {
            state.analyzeSelections = { ...state.analyzeSelections, [update.type] : {...state.analyzeSelections[update.type], [update.option]: update.value }};
        },
        addAnalyzeSortOption(state, update) {
            state.analyzeSelections = {
                ...state.analyzeSelections, [update.type] :
                    {...state.analyzeSelections[update.type], [TABLESELECTIONS.sort]:
                            { ...state.exploreSelections[update.type][TABLESELECTIONS.sort], [update.option]: update.value }
                    }
            };
        },
        addAnalyzePagingOption(state, update) {
            state.exploreSelections = { ...state.exploreSelections, [TABLESELECTIONS.paging]: { ...state.exploreSelections[TABLESELECTIONS.paging], [update.option]: update.value }};
            state.analyzeSelections = {
                ...state.analyzeSelections, [update.type] :
                    {...state.analyzeSelections[update.type], [TABLESELECTIONS.paging]:
                            { ...state.exploreSelections[update.type][TABLESELECTIONS.paging], [update.option]: update.value }
                    }
            };
        }
    },
    actions: {
        updateCurrentDataSource({ commit }, currentDataSource) {
            commit('mutateCurrentDataSource', currentDataSource);

            // replace TA3/SIN/TEAM3-version/ with TA2/
            if(currentDataSource) {
                const newKbDataSource = ta3DataSource(currentDataSource) ? convertTA3toTA2Route(currentDataSource) : currentDataSource;
                commit('setDefaultKbDataSource', newKbDataSource);
                //clear stored kb data, arguments, and types for events and relations based on the previously stored TA2 datasource
                commit('removeExploreKB');
                commit('removeArgumentsAndTypes');
            }
        },
        updatePrototypeRoles({ commit, state }, prototype) {
                const cluster = state.knowledgeBase[prototype.category][prototype.id];
                if(cluster) {
                    commit('updateClusterPrototype', { cluster: cluster, prototype: prototype } );
                }
        },
        updateFilters({ commit, state }, update) {
            if(update.type === DATATYPES.eventType.id || update.type === DATATYPES.relationType.id) {

                if(state.filters && state.filters[update.type] && state.filters[update.type].hasOwnProperty(update.index)) {
                    commit('replaceCategoryFilterByIndex', update)
                }
                else {
                    commit('updateCategoryFilters', update);
                }
            }
            else if(update.type === DATATYPES.entityType.id || update.type === DATATYPES.argumentName.id || update.type === DATATYPES.kbId.id) {
                if(update.filter) {
                    commit('updateConditionalFilters', update);
                }
            }
            else {
                commit('updateSingleFilters', update);
            }

            if(update[FILTERPROPS.condition] && update[FILTERPROPS.condition] !== '') {
                commit('updateFilterCondition', update);
            }
        },
        retrieveFilters({ commit, state }, id) {
            if(Object.keys(state.savedFilters).length > 0) {
                commit('resetFilters', state.savedFilters[id]);
            }
        },
        updateDataSourceProperties({ commit, state }, update) {
            commit('mutateCurrentDataSource', state.defaultKbDataSource);
            commit('updateDataSourceList', update);
        },
        updateCategoryArgumentsProperties({ commit, state }, data) {
            commit('updateCategoryArguments', data);

            //In order to get all arguments combine values, remove duplicates, and sort the arguments
            const combinedArguments = Object.values(state.categoryArguments).flat();
            commit('updateAllArguments', sortCaseInsensitive(combinedArguments.filter((a, b) => combinedArguments.indexOf(a) === b)));
        },
        updateSearchTerm({ commit }, update) {
            if(update.type) {
                commit('updateTerm', update);
            }
            else {
                commit('removeTerm');
            }

        },
        updateUrlParameters({ commit, state }, update) {
            if(update.params) {
                commit('updateSavedUrlParameters', {name: update.name, params: update.params});

                if(update.params.term) {
                    let termQuery = update.params.term.split(':');
                    if(termQuery[0] !== state.term.type && termQuery[1] !== state.term.input) {
                        commit('updateTerm', {type: termQuery[0], input: termQuery[1]});
                    }
                }
            }
            else {
                commit('removeSavedUrlParametersByRoute', update.name);
            }

        },
        removeFilter({ commit, state }, update) {
            if(update.type !== null && update.index && state.filters.hasOwnProperty(update.type)) {
                if(state.filters[update.type].hasOwnProperty(FILTERPROPS.vals)) {
                    commit('removeFilterByValueId', update)
                }
                else {
                    commit('removeCategoryFilterByIndex', update);
                }

                let filterKeys = state.filters[update.type].hasOwnProperty(FILTERPROPS.vals) ? Object.keys(state.filters[update.type][FILTERPROPS.vals])
                    : state.filters[update.type];
                //if there are no longer filters for this filter type, remove the filter type
                if(filterKeys.length === 0) {
                    commit('removeFiltersByType', update.type);
                }
            }
            else if(update.type) {
                commit('removeFiltersByType', update.type);
            }
            else {
                console.warn('Deletion message not formatted correctly. Must have a type')
            }
        },
        updateExploreSelections({ commit, state }, update) {
            const viewFields = [TABLESELECTIONS.tab, TABLESELECTIONS.display];
            const sortFields = [TABLESELECTIONS.sortBy, TABLESELECTIONS.sortDesc];
            const pagingFields = [TABLESELECTIONS.pageNumber, TABLESELECTIONS.pageStart, TABLESELECTIONS.itemsPerPage];

            if(viewFields.includes(update.option)) {
                //loop through state and remove all of the options that are not tab or display
                for (let selection of Object.keys(state.exploreSelections)) {
                    if(!viewFields.includes(selection)) {
                        commit('removeExploreSelectionsByOption', selection);
                    }
                }
            }

            //add new selection
            commit(
                sortFields.includes(update.option) ? 'addExploreSortOption' :
                    pagingFields.includes(update.option) ? 'addExplorePagingOption' :
                    'addExploreSelections',
                update
            );
        },
        updateAnalyzeSelections({ commit }, update) {
            const sortFields = [TABLESELECTIONS.sortBy, TABLESELECTIONS.sortDesc];
            const pagingFields = [TABLESELECTIONS.pageNumber, TABLESELECTIONS.pageStart, TABLESELECTIONS.itemsPerPage];

            //add new selection
            commit(
                sortFields.includes(update.option) ? 'addAnalyzeSortOption' :
                    pagingFields.includes(update.option) ? 'addAnalyzePagingOption' :
                        'addAnalyzeSelections',
                update
            );
        }
    },
    getters: {
        getDateFilter: state => state.filters[DATATYPES.dateRange.id],
        getFilterKeys: state => Object.keys(state.filters),
        getFilterByType: state => filter => state.filters[filter],
        getSavedFilterByTypeAndIndex: state => (id, type, index) => state.savedFilters[id][type][index],
        getSavedHypothesisById: state => (id) => state.savedHypotheses[id],
        getQueryParams: state => ({
            currentDataSource: state.currentDataSource,
            term: state.term,
            filter: state.filters,
            url: state.savedUrlParameters,
        }),
        getStoreByRoute: state => (route) => {
            let ret;
            if (route === VUEROUTES.ta3)  {
                ret = state.dataSourceList.find((dataSource) => dataSource === state.defaultHypothesisDataSource) ||
                    state.dataSourceList.find(ta3DataSource);
            } else if (route === VUEROUTES.ta2) {
                ret = state.dataSourceList.find((dataSource) => dataSource === state.defaultKbDataSource) ||
                    state.dataSourceList.find(ta2DataSource);
            }
            return ret;
        }
    }
});
